  `blackCastleQueen` tinyint(4) NOT NULL DEFAULT '1',
  `pendingDraw` tinyint(4) NOT NULL DEFAULT '0',
  `fiftyMoveDraw` int(11) NOT NULL DEFAULT '0',
  `lastMove` varchar(128) NOT NULL DEFAULT '''Game Created''',
  `lastMoveSrc` int(11) DEFAULT NULL,
  `lastMoveDst` int(11) DEFAULT NULL,
  `time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `gameId` (`game_id`),
  KEY `turn` (`turn`),
